import React, { useState } from "react";
import { Form, Button, Alert } from "react-bootstrap";
import axios from "axios";

const VendorRegistration = () => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    dispensaryName: "",
    email: "",
    password: "",
    acceptedPayments: [],
  });
  const [error, setError] = useState(null); // Backend error handling
  const [success, setSuccess] = useState(false); // Registration success message

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handlePaymentChange = (e) => {
    const { value, checked } = e.target;
    setFormData((prev) => {
      const updatedPayments = checked
        ? [...prev.acceptedPayments, value]
        : prev.acceptedPayments.filter((method) => method !== value);
      return {
        ...prev,
        acceptedPayments: updatedPayments,
      };
    });
  };

  const handleSubmit = async () => {
    try {
      setError(null); // Reset error state
      const response = await axios.post("/api/auth/register", formData);

      if (response.data.success) {
        setSuccess(true);
      }
    } catch (err) {
      setError(err.response?.data?.message || "Error registering vendor. Please try again.");
    }
  };

  return (
    <div className="container mt-5">
      <h2 className="mb-4 text-center">Vendor Registration</h2>
      {error && <Alert variant="danger">{error}</Alert>}
      {success && <Alert variant="success">Vendor registered successfully!</Alert>}

      <Form>
        <Form.Group className="mb-3">
          <Form.Label>First Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your first name"
            name="firstName"
            value={formData.firstName}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Last Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your last name"
            name="lastName"
            value={formData.lastName}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Dispensary Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your dispensary name"
            name="dispensaryName"
            value={formData.dispensaryName}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Email</Form.Label>
          <Form.Control
            type="email"
            placeholder="Enter your email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Password</Form.Label>
          <Form.Control
            type="password"
            placeholder="Create a password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Accepted Payments</Form.Label>
          <div className="d-flex flex-wrap gap-2">
            {[
              "CASH",
              "CREDIT_CARD",
              "DEBIT_CARD",
              "MOBILE_PAYMENT",
              "BANK_TRANSFER",
              "CRYPTOCURRENCY",
            ].map((method) => (
              <Form.Check
                key={method}
                type="checkbox"
                id={method}
                label={method.replace("_", " ")}
                value={method}
                checked={formData.acceptedPayments.includes(method)}
                onChange={handlePaymentChange}
              />
            ))}
          </div>
        </Form.Group>

        <Button variant="primary" onClick={handleSubmit}>
          Register
        </Button>
      </Form>
    </div>
  );
};

export default VendorRegistration;
